import React from 'react';
import { useNavigate } from 'react-router-dom';
const Head = () => {
    const navigate = useNavigate();
  
    const handlePortfolioClick = () => {
      navigate('/head');
    };

    return (
        <header>
        <div className="row">
        <div className="col-12 p-3 bg_danger text-white text-center">
          <div className="header">
            <nav>
            <i className="bi bi-list" style={{ fontSize: "2rem", cursor: "pointer" }}></i>
            <img src="/logo.png" alt="ICA Logo" className="img-fluid" style={{ maxWidth: '25%' }} />
            <i className="bi bi-person" style={{ fontSize: "2rem", color: "gray" }}></i>
            </nav>
            
            
            
          </div>
        </div>
      </div>
        </header>
     );
};

export default Head;
